def find_second_largest(numbers: list) -> int:
    if len(numbers) < 2:
        raise ValueError("The list should have at least two elements to find the second largest.")

    largest = max(numbers)
    second_largest = min(numbers)

    for number in numbers:
        if largest > number > second_largest:
            second_largest = number

    return second_largest
